import React from "react";
import { NavLink } from "react-router-dom/cjs/react-router-dom.min";
const Home = () => {
  const web = "https://picsum.photos/200";
  return (
    <>
      <section id="header" className="d-flex align-item-center">
        <div className="container-fluid nav_bg">
          <div className="row">
            <div className="col-10 mx-auto">
              <div className="row">
                <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1 d-flex justify-content-center flex-column">
                  <h1>
                    Grow your business with{" "}
                    <strong className="brand_name"> Thapa technical</strong>
                  </h1>
                  <h2 className="my-3">
                    We are the team of talented Developer making Websites
                  </h2>
                  <div className="mt-3">
                    <NavLink className=" btn-get-started " to="/service">Get started</NavLink>
                  </div>
                </div>
                <div className="col-lg-6 order-1 or order-lg-2 hader-img">
                  <img src={web} className="img-fluid animated" alt="image" />
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};
export default Home;
